create table airport
(
    id               bigint auto_increment
        primary key,
    iata_code        varchar(16) not null,
    icao_code        varchar(16) null,
    airport_chn_name varchar(64) null,
    airport_eng_name varchar(64) null,
    country_code     varchar(32) null,
    country_chn_name varchar(64) null,
    country_eng_name varchar(64) null,
    city_chn_name    varchar(64) null,
    city_eng_name    varchar(64) null,
    description      longtext    null,
    is_available     tinyint(1)  not null,
    is_delete        tinyint(1)  not null,
    create_datetime  datetime(6) not null,
    create_by        varchar(32) not null,
    update_datetime  datetime(6) not null,
    update_by        varchar(32) not null,
    elevation        varchar(64) null,
    latitude         varchar(64) null,
    longitude        varchar(64) null,
    time_zone        varchar(64) null,
    utc              varchar(16) null,
    constraint iata_code
        unique (iata_code)
);

create index airport_create_datetime_6832d190
    on airport (create_datetime);

create index airport_update_datetime_4dd0f21f
    on airport (update_datetime);

