INSERT INTO scomsdb.airport (id, iata_code, icao_code, airport_chn_name, airport_eng_name, country_code, country_chn_name, country_eng_name, city_chn_name, city_eng_name, description, is_available, is_delete, create_datetime, create_by, update_datetime, update_by, elevation, latitude, longitude, time_zone, utc) VALUES (1397, 'DXB', 'OMDB', '迪拜国际机场', 'Dubai International Airport', 'AE', '阿联酋', 'UNITED ARAB EMIRATES', '迪拜', 'Dubai', '迪拜国际机场（Dubai International Airport）是阿联酋迪拜的主要机场，也是阿联酋航空公司的枢纽港，可起降所有的机型。 因为机场内拥有众多的商店，因此它成了在阿联酋购买免税商品的主要场所。 2004年9月28日，三号航站楼在建设过程中发生部分坍塌。航站楼是由法国设计师保罗·安德鲁设计的，他设计的夏尔·戴高乐国际机场在2004年3月23日也发生了同样的情况。 迪拜国际机场（Dubai International Airport）是中东地区最大的航空港，迪拜机场2000年底刚刚完成耗资5.4亿美元的扩建计划，使迪拜机场的接待能力进一步提高，每日近300多个迪拜航班飞往世界各地 阿联酋迪拜政府投资330亿美元兴建的这座世界上最大的机场紧邻杰贝拉里，起名为迪拜世界中央国际机场（Dubai World Central International Airport），是全球最大、最先进的机场，它的总吞吐量是目前迪拜国际机场总吞度量的10倍。', 1, 0, '2022-02-14 11:00:00', 'admin', '2022-02-14 11:00:00', 'admin', '34', '25.2527999878', '55.3643989563', 'Asia/Dubai', '');
